        public bool hayvalorreferencia(Item oItem)
        {
            ISession m_session = NHibernateHttpModule.CurrentSession; 
            // si hay datos no borra y no actualiza  ==> considera que el efector ya decidió sus VR.
            ICriteria crit2 = m_session.CreateCriteria(typeof(ValorReferencia));
            crit2.Add(Expression.Eq("IdItem", oItem));
            crit2.Add(Expression.Eq("IdEfector", this.IdEfector));

            if (crit2.List().Count > 0)
            
                return true;
                else
                return false;
            
        }

